import React from 'react';
import './Footer.css';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <div className='footer'>
      <section className='subscription'>
        <p className='subscription-heading'>
          Join the Gallery Gazette to discover our finest artworks and exclusive exhibitions.
        </p>
      </section>
      <section className='social'>
        <div className='social-wrap'>
          <div className='logo'></div>
          <small className='rights'>Illuminated Imagination © 2024</small>
          <div className='icons'>
            <Link className='icon-link facebook' to='/' target='_blank' aria-label='Facebook'>
              <i className='fab fa-facebook-f' />
            </Link>
            <Link className='icon-link instagram' to='/' target='_blank' aria-label='Instagram'>
              <i className='fab fa-instagram' />
            </Link>
            <Link className='icon-link youtube' to='/' target='_blank' aria-label='Youtube'>
              <i className='fab fa-youtube' />
            </Link>
            <Link className='icon-link twitter' to='/' target='_blank' aria-label='Twitter'>
              <i className='fab fa-twitter' />
            </Link>
            <Link className='icon-link linkedin' to='/' target='_blank' aria-label='LinkedIn'>
              <i className='fab fa-linkedin' />
            </Link>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Footer;
